import React from 'react';

const h = React.createElement;

    export default class ProgressBar extends React.Component {
        constructor (props) {
          super();
          this.steps = ["0","1","2","3","4"];
          this.step=props;
          this.state = {};
        }
        render() {
          return h("div", {className:"ProgressBar"},
          <RenderProgress step = {step} steps = {steps}/>
          );
        }

        RenderProgress(){
            return h("span", {}, this.steps.forEach(val => {
                if (val === this.step){return <span classname="currentstep"></span>};
                return <span classname="notcurrentstep"></span>
            }))
      }
    }
